import React from "react";
import Table from "../components/Table";
import StackChart from "../components/StackChart";
import sideBar from "../components/sideBar";

function App() {
    return (
    <div>
        <sideBar />
        <Table />
        <StackChart />
    </div>
    )
}

export default App;
